import axios from 'axios';
import React, { Component } from 'react';

import { localStorageGet, localStorageSet } from '../../../../StorageGS';

import './index.scss'

export default class index extends Component {
    componentDidMount() {
        let keyword
        if(this.props.location.state.keyword === '') {
            keyword = localStorageGet("keyword", this.props.location.state.keyword)
        }else {
            keyword = this.props.location.state.keyword
        }
        
        axios.get('http://localhost:3001/api/searchresults', { params: {
            keyword
        } })
        .then( function(response) {
            console.log(response)
        })
        .catch( function(err) {
            console.log(err)
        })
    }

    render() {
        return (
            <div className="results">
                <div className="contain">
                    <div className="head-contain">
                        <div className="search-wrap">
                            <div className="logo-input clearfix">
                                <a className="search-logo"></a>
                                <div className="search-block">
                                <div className="input-wrap">
                                    <input type="text" maxLength="100" autoComplete="off" id="search-keyword" />
                                </div>
                                <div className="search-button">
                                    <i className="icon-search-white"></i>
                                </div>
                            </div>
                            </div>
                            
                        </div>
                    </div>
                    <div className="body-contain"></div>
                </div>
            </div>
        )
    }
}
